// SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;
import { ERC721 } from '@openzeppelin/contracts/token/ERC721/ERC721.sol';
import { IERC165 } from '@openzeppelin/contracts/utils/introspection/IERC165.sol';
import { ERC721Enumerable } from '../extras/ERC721Enumerable.sol';
import { CrawlerContract } from '../CrawlerContract.sol';
import { Strings } from '@openzeppelin/contracts/utils/Strings.sol';
import { Base64 } from '@openzeppelin/contracts/utils/Base64.sol';

contract TestToken is ERC721, ERC721Enumerable, CrawlerContract {
	using Strings for uint256;

	uint256 private _mintedCount;

	event Minted(address indexed to, uint256 indexed tokenId);

	constructor() ERC721("TestToken", "TEST") {}

	// Interfaces
	function supportsInterface(bytes4 interfaceId) public view override (ERC721, ERC721Enumerable, CrawlerContract) returns (bool) {
		return ERC721Enumerable.supportsInterface(interfaceId) || CrawlerContract.supportsInterface(interfaceId);
	}
	function _beforeTokenTransfer(address from, address to, uint256 tokenId, uint256 batchSize) internal override (ERC721, ERC721Enumerable) {
		super._beforeTokenTransfer(from, to, tokenId, batchSize);
	}
	function _totalSupply() public view override returns (uint256) {
		return _mintedCount;
	}

	function mint() public payable returns (uint256) {
		uint256 tokenId = _mintedCount + 1;
		_safeMint(msg.sender, tokenId);
		emit Minted(msg.sender, tokenId);
		_mintedCount = tokenId;
		return tokenId;
	}

	function tokenURI(uint256 tokenId) public view override returns (string memory) {
		require(_exists(tokenId), 'Invalid tokenId');
		bytes memory json = abi.encodePacked(
			'{'
				'"name":"Test Token #', tokenId.toString(), '",'
				'"description":"This is a test token",'
				'"image":"data:image/svg+xml;base64,',
					Base64.encode(
						abi.encodePacked(
							"<svg xmlns='http://www.w3.org/2000/svg' version='1.1' width='400' height='400' viewBox='0 0 1 1'>"
							"<defs>"
								"<linearGradient id='G' x1='0' x2='0' y1='0' y2='1'>"
									"<stop offset='0%' stop-color='white'/>"
									"<stop offset='50%' stop-color='black'/>"
									"<stop offset='100%' stop-color='white'/>"
								"</linearGradient>"
							"</defs>"
							"<style>"
								".B{fill:#000000}"
								".T{font-family:monospace;font-size:0.025em;fill:#ffffff}"
							"</style>"
							"<rect fill='url(#G)' width='1' height='1' shape-rendering='crispEdges'/>"
							"<text class='T' id='entry' x='50%' y='50%' dominant-baseline='middle' text-anchor='middle'>", tokenId.toString(), "</text>"
							"</svg>"
						)
					),
				'"'
			'}'
		);
		return string(abi.encodePacked('data:application/json;base64,', Base64.encode(bytes(json))));
	}
}
